import './App.scss';
import { NavBar } from './Components/NavBar';
import S3connection from './Components/S3Connection/S3Connection';
import { VideoUpload } from './Components/VideoUpload/VideoUpload';

function App() {
  return (
    <div className="App">
      <NavBar />
      <VideoUpload />
      <S3connection />
    </div>
  );
}

export default App;
